import Login from "./Login";

const authentication={
    isLoggedIn:false,
    onAuthentication(){
        this.isLoggedIn=true;
    },
    getLogInStatus(){
        return this.isLoggedIn;
    }
}

function Home() {


    return (
        <div>
            <h1>Welcome to home page</h1>
            <div>
                <Login/>
            </div>
        </div>

    );
}

export default Home;
